import './Products.css';
import Card from '../Card/Card';

const productList = [
  {"title":"Комплект с аметистовыми друзами",
    "price":"1900",
    "image":"images/51-3.png",
  },
  {"title":"Дорогой товар",
    "price":"13900",
    "image":"images/59-2.png",
  },
  {"title":"Товар с неадекватно длинным названием, чтобы проверить контейнер",
    "price":"9700",
    "image":"images/94.png",
  },
]

export default function Products() {
  return (
    <section className='products'>
      <ul className='products__list'>
        {productList.map((product) => (
          <Card
            image={product.image}
          ></Card>
        ))}
      </ul>
    </section>
  )
}
